  //       {}
  //     );
  //     console.log("Response:", response.data);
  //   } catch (error) {
  //     console.error("Error:", error);
  //   }
  // };
  //   postData();
  // }, []);
  const postData = async () => {
    try {
      const response = await axios.post(
        "http://localhost:5500/data/open-link",
        {}
      );
      console.log("Response:", response.data);
    } catch (error) {
      console.error("Error:", error);
    }
  };
  return (
    <div className="App">
      <button onClick={postData}></button>
    </div>
  );
}

export default App;
